import React from 'react';
import logo from '../Images/Logo.jpg';

function Footer() {
    return (
        <div >
            <footer className="footer">
                <div className="row">
                    <div className="col">
                        <img src={logo} className="footer-logo" alt="Image" />
                    </div>
                </div>
            </footer>
        </div>
    )
}

export default Footer;
